    "valley-city-wetland-management-district-annual-narrative-report-calendar-year-1973",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Valley City Wetland
    Management District during the 1973 calendar year. The report begins by giving a
    description of the area, status of the acquisition program, and habitat conditions
    during the year. Wildlife- including migratory birds, upland game birds, big game
    animals, furbearers, predators, rodents, raptors, rare and endangered species, fish,
    and disease- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, cultivated crops, and vegetation control. Resource
    management is described; topics include grazing, haying, and fur harvest. A progress
    report on field investigations and applied research is also provided. The public
    relations section discusses recreational uses, Refuge visitors, Refuge participation,
    hunting, violations, and safety.",nt"license_title": "License Not Specified",nt"extras":
